import { Box } from '@mui/material';
import React from 'react'

const BoxStyle = {

}

function ItemBox() {

    const itemNameBox = (
        <Box
            color="black"
            bgcolor="gray" p={1}
            justifyContent="center"
            sx={{ display: 'flex', border: 1 }}>
                <header>Item Name</header>
        </Box>
    );

    const descriptionBox = (
        <Box
            color="black"
            bgcolor="gray" p={1}
            justifyContent="center"
            sx={{ display: 'flex' }}>
                <header>Description</header>
        </Box>
    )

    const priceBox = (
        <Box
            color="black"
            bgcolor="gray" p={1}
            justifyContent="center"
            sx={{ display: 'flex' }}>
                <header>Price</header>
        </Box>
    )

    return (
        <div style={{
            marginLeft: '10%',
            marginTop: '60px',
            width: '30%',
        }}>
            {itemNameBox}
            {descriptionBox}
        </div>
    );
}

export default ItemBox
